window.bookSummaryJSON = "<p>The fourth and final installment in the spellbinding series from irrepressible, number-one <i>New York Times</i> best-selling author Maggie Stiefvater. </p> <p>All her life, Blue has been warned that she will cause her true love's death. She doesn't believe in true love and never thought this would be a problem, but as her life becomes caught up in the strange and sinister world of the Raven Boys, she's not so sure anymore. </p> <p>In a starred review for <i>Blue Lily, Lily Blue</i>, <i>Kirkus Reviews</i> declared: \"Expect this truly one-of-a-kind series to come to a thundering close.\" </p>"; 
